import React from 'react';
import SeasonDisplay from './SeasonDisplay';

const successCallback = (position) => {
    `Your position is ${position.coords.lattitude}`;
}

const errorCallback = () => {
    'Sorry. We cannot detect your location using the browser-based geolocation object';
}

function App() {
    window.navigator.geolocation.getCurrentPosition(successCallback, errorCallback);
    return (
        <div>
            <h1 class="ui header">My App Component</h1>
            <div>Merry Christmas, React! I really like you!</div>
            <SeasonDisplay />
        </div>
    )
}

export default App;
